import React, { useState } from 'react';
import { FaSearch, FaLocationArrow } from 'react-icons/fa';

const SearchBar3 = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [location, setLocation] = useState('');
  const [category, setCategory] = useState('');
  const [isLocationLoading, setIsLocationLoading] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Buscando:', { searchQuery, location, category });
  };

  const handleNearMe = async (e) => {
    e.preventDefault();
    if (isLocationLoading) return;
    
    setIsLocationLoading(true);
    try {
      const position = await new Promise((resolve, reject) => {
        navigator.geolocation.getCurrentPosition(resolve, reject, {
          timeout: 10000,
          enableHighAccuracy: true
        });
      });
      console.log('Ubicación del usuario:', position.coords);
      alert('Ubicación obtenida con éxito!');
    } catch (error) {
      console.error('Error al obtener ubicación:', error);
      alert('No se pudo obtener la ubicación. Por favor, asegúrate de haber otorgado los permisos necesarios.');
    } finally {
      setIsLocationLoading(false);
    }
  };

  return (
    <div className="w-full bg-white dark:bg-gray-800 py-4 md:py-6 px-3 sm:px-4 md:px-6">
      <div className="max-w-7xl mx-auto">
        <form onSubmit={handleSearch} className="w-full">
          <div className="flex flex-col sm:flex-row gap-2 sm:gap-3 md:gap-4">
            {/* Selector de Ciudad */}
            <div className="relative flex-1 min-w-0">
              <select
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                className="w-full h-12 pl-3 pr-8 text-sm sm:text-base text-gray-700 dark:text-gray-200 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-pink-500 focus:border-transparent appearance-none"
              >
                <option value="">Selecciona Ciudad</option>
                <option value="monterrey">Monterrey</option>
                <option value="cdmx">CDMX</option>
                <option value="guadalajara">Guadalajara</option>
                <option value="cancun">Cancún</option>
              </select>
              <div className="absolute inset-y-0 right-0 flex items-center pr-3 pointer-events-none">
                <svg className="w-4 h-4 text-gray-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
              </div>
            </div>

            {/* Selector de Categoría */}
            <div className="relative flex-1 min-w-0">
              <select
                value={category}
                onChange={(e) => setCategory(e.target.value)}
                className="w-full h-12 pl-3 pr-8 text-sm sm:text-base text-gray-700 dark:text-gray-200 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-pink-500 focus:border-transparent appearance-none"
              >
                <option value="">Todas las categorías</option>
                <option value="restaurantes">Restaurantes</option>
                <option value="hoteles">Hoteles</option>
                <option value="atracciones">Atracciones</option>
              </select>
              <div className="absolute inset-y-0 right-0 flex items-center pr-3 pointer-events-none">
                <svg className="w-4 h-4 text-gray-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
                </svg>
              </div>
            </div>

            {/* Campo de Búsqueda */}
            <div className="relative flex-1 min-w-0">
              <input
                type="text"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                placeholder="¿Qué buscas?"
                className="w-full h-12 pl-3 pr-10 text-sm sm:text-base text-gray-700 dark:text-gray-200 bg-white dark:bg-gray-700 border border-gray-200 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-pink-500 focus:border-transparent"
              />
              <div className="absolute inset-y-0 right-0 flex items-center pr-3 pointer-events-none">
                <FaSearch className="w-4 h-4 text-gray-500" />
              </div>
            </div>

            {/* Botones */}
            <div className="flex flex-col sm:flex-row gap-2 sm:gap-3">
              <button
                type="button"
                onClick={handleNearMe}
                disabled={isLocationLoading}
                className="h-12 px-3 sm:px-4 flex items-center justify-center gap-1.5 text-sm sm:text-base text-pink-600 dark:text-pink-400 bg-white dark:bg-gray-700 border border-pink-600 dark:border-pink-400 rounded-lg hover:bg-pink-50 dark:hover:bg-gray-600 transition-colors whitespace-nowrap"
              >
                <FaLocationArrow className="w-3.5 h-3.5 flex-shrink-0" />
                <span className="truncate">Cerca de mí</span>
              </button>
              
              <button
                type="submit"
                className="h-12 px-4 sm:px-6 flex items-center justify-center gap-2 text-sm sm:text-base text-white bg-pink-600 hover:bg-pink-700 rounded-lg transition-colors whitespace-nowrap"
              >
                <FaSearch className="w-4 h-4 flex-shrink-0" />
                <span>Buscar</span>
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
};

export default SearchBar3;
